import React from 'react';
import {
    Router,
    Link
  } from "react-router-dom";
import './Header.css';

export function Header(){
    return (
        <div>
            <div className="logo">
                velopert
            </div>
            <div className="menu">
                <Link to={'/'}>홈</Link>
                <Link to={'/about'}>소개</Link>
                <Link to={'/post'}>포스트</Link>
            </div>
        </div>
    );
};

export default Header;
